import * as React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  border-bottom: 1px solid black;
`;

const Navi =styled.ul`
  padding: 10px 15px;
  margin: 0;
  list-style: none;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
`;

const NaviItems = styled.li`
  padding-right: 15px;
`;

const Navigation = () => {
  return (
    <Container>
      <Navi>
        <NaviItems>
          <Link href="/">Home</Link></NaviItems>
        <NaviItems>menu1</NaviItems>
        <NaviItems>menu2</NaviItems>
      </Navi>
    </Container>
  )
};

export default Navigation;
